import React from "react";
import cl from "./MyProduct.module.css"

const MyProduct=({items})=>{

    const length=items.length

    

    return(
        <div className={length%3==0?cl.whole:cl.whole2}> 



  
       {items.map((e)=>
       <div className={cl.main} key={e.id}>
        <h2>{e.name}</h2>
        <p>{e.desctiprion}</p>
        <h3>{e.price}</h3>


       </div>)}
 

        
        </div>
    )
}

export default MyProduct;
